import React, { Component } from "react";

class Landing extends Component {
  form = () => {
    return (
      <form>
        <label>
          Name:
          <input type="select" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    );
  };
  render() {
    return (
      <>
        <h1>On Landing</h1>
        <div>{this.form()}</div>
      </>
    );
  }
}
export default Landing;
